import React, { Component } from 'react';
import "./LeftSide.css";
import ImageLayout from '../ImageLayout';
import covid from "../../../../images/covid.svg";
import groups from "../../../../images/groups.svg";
import memories from "../../../../images/memories.png";

class LeftSide extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }

    render() { 
        return ( 
         <div>
             <ImageLayout image={covid} text="COVID-19 Information Centre" />
             <ImageLayout image={groups} text="Friends" />
             <ImageLayout image={memories} text="Memories" />

         </div> 
        );
    }
}

export default LeftSide;
